USE `#30daysqlquerychallenge`

/*
PROBLEM STATEMENT:
Given table showcases details of pizza delivery order for the year of 2023. If an order is delayed then the whole order is given for free.
Any order that takes 30 minutes more than the order time is considered as delayed order. 
Identify the percentage of delayed order for each month and also display the total no of free pizzas given each month. Sort the result 
in order of month as shown in expected output
*/

CREATE TABLE `Day#19`
(
ORDER_ID INT,
ORDER_TIME DATETIME,
EXPECTED_DELIVERY DATETIME,
ACTUAL_DELIVERY DATETIME,
NO_OF_PIZZAS INT,
PRICE FLOAT
);


--Solution
WITH FREE_PIZZA AS
(
    SELECT 
        MONTHNAME(ORDER_TIME) AS Month,
        YEAR(ORDER_TIME) AS YEAR,
        SUM(`NO_OF_PIZZAS`)  AS FREE_PIZZAS
    FROM `Day#19`
    WHERE ACTUAL_DELIVERY > EXPECTED_DELIVERY 
    GROUP BY 1,2
    ORDER BY MONTH(ORDER_TIME) 
), DELAYED_DELIVERY AS
(
    SELECT
        MONTHNAME(ORDER_TIME) AS Month, 
        ROUND(SUM(CASE WHEN ACTUAL_DELIVERY > EXPECTED_DELIVERY THEN 1 ELSE 0 END) * 100.0 / COUNT(*),2) AS DELAYED_DELIVERY_PERC
    FROM `Day#19`
    WHERE ACTUAL_DELIVERY IS NOT NULL
    GROUP BY 1
    ORDER BY MONTH(ORDER_TIME)
)
SELECT 
    CONCAT(LEFT(FREE_PIZZA.MONTH,3),"-",RIGHT(FREE_PIZZA.YEAR,2)) AS PERIOD,
    CONCAT(DELAYED_DELIVERY_PERC,"%") AS DELAYED_DELIVERY_PERC,
    FREE_PIZZAS
FROM FREE_PIZZA JOIN DELAYED_DELIVERY 
    ON `FREE_PIZZA`.Month = `DELAYED_DELIVERY`.Month
